#include <iostream>
#include <cmath>
using namespace std;

int main()
{
   const int sizE = 50;
   double a[sizE]={0.};
   double sum=0;
   for (int i =0;i<sizE;i++ ){
    a[i]=((15*i)/(pow(i,2)+1))*(pow(-1,i));
    cout<<""<<a[i]<<endl;
   }
    double b[sizE]={0.1};
    for (int i=0;i<sizE;i++){
        b[i]=a[i]/(i+1);
        if(b[i]>0){
            sum+=b[i];
        }
    }
    cout<<"sum"<<sum;
    return 0;
}
